import React from 'react'
import {Row, Col} from 'react-grid-system';

export default function RecommendedCards(props) {
    return (
        <div>
            <Row className="mt-5">
                <Col>
                    <div className="card-movie">
                        <h1>test</h1>
                        <p>lorem</p>
                    </div>
                </Col>
            </Row>
        </div>
    )
}
